import Image from 'next/image';
import { Modal } from 'antd';
import NiceModal, { useModal } from '@ebay/nice-modal-react';
import { LinkedinShareButton, TwitterShareButton } from 'react-share';
import fi_chevrons_right from '../../../public/svgs/fi_chevrons-right.svg';

export const JoinWaitListModal = NiceModal.create(() => {
  const modal = useModal();

  const shareUrl = 'http://www.sparkpayhq.com/';
  const title = 'SparkPay';
  return (
    <Modal
      title="Hello Antd"
      visible={modal.visible}
      onOk={modal.hide}
      onCancel={modal.hide}
      afterClose={modal.remove}
      className="JoinWaitListModal"
    >
      <div className="JoinWaitListModal__content">
        <div className="JoinWaitListModal__svg">
          <PhoneIllustrationSVG />
        </div>

        <div className="JoinWaitListModal__text">
          <h4 className="JoinWaitListModal__title">
            Get your friends onboard
            <span
              style={{ display: 'block', width: '12%', marginLeft: '0.5rem' }}
            >
              <RocketIllustrationSVG />
            </span>
          </h4>
          <p className="JoinWaitListModal__subtext">
            Like what we are building? Then go ahead and gift your friends early
            access
          </p>

          <div className="JoinWaitListModal__share">
            <Image src={fi_chevrons_right} alt="chevrons-right icon" />{' '}
            <span>share via</span>
          </div>

          <div className="JoinWaitListModal__btn-area">
            <TwitterShareButton
              url={shareUrl}
              className="twitter__share-button"
            >
              <div>
                <TwitterSVG />
                Twitter
              </div>
            </TwitterShareButton>
            {/* <button>
              <LinkedinSVG />
              Linkedin
            </button> */}

            <LinkedinShareButton
              url={shareUrl}
              summary="Like what we are building? Then go ahead and gift your friends early access"
              title={title}
              className="linkedin__share-button"
            >
              <div>
                <LinkedinSVG />
                Linkedin
              </div>
            </LinkedinShareButton>
          </div>
        </div>
      </div>
    </Modal>
  );
});

